function insert(e){var n=document.getElementById("resultado").innerHTML;document.getElementById("resultado").innerHTML=n+e}function clean(){document.getElementById("resultado").innerHTML=""}function back(){var e=document.getElementById("resultado").innerHTML;document.getElementById("resultado").innerHTML=e.substring(0,e.length-1)}function calcular(){var resultado=document.getElementById("resultado").innerHTML;document.getElementById("resultado").innerHTML=resultado?eval(resultado):" "}